import React from 'react'
import Card from './card'
import './card.css'
import Imagen1 from '../imagenes/imagenhome.jpg'
const cards= [
{
    id:1,
    image: Imagen1,
    title:"",
    text:""
},
{
    id: 2,
    image:"",
    title: "¿Qué es Wheeltrack?",
    text: "asdasdasdasdasd"
},
]
function HomeCards() {
    return (
        <div className="container d-flex justify-content-center aling-items-center h-100 bg">
            <div className="row">
                {
                    cards.map(card => (
                        <div className="col" key={cards.id}>
                            <Card title={cards.title} imageURL={cards.image} text={cards.text}/>
                        </div>
                    )
                    )
                }
            </div>
        </div>
    )
}

export default HomeCards
